import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { FaEdit, FaTrash } from 'react-icons/fa';
import url from '../../config';

export default function Parcerias() {
    const [parceriasData, setParceriasData] = useState([]);

    useEffect(() => {
        const fetchParcerias = async () => {
            try {
                const response = await fetch(url + 'protocolosparceria/'); // Ajuste a URL conforme necessário
                if (!response.ok) {
                    throw new Error('Erro ao buscar parcerias');
                }
                const data = await response.json();
                setParceriasData(data);
            } catch (error) {
                console.error('Erro ao buscar parcerias:', error);
            }
        };

        fetchParcerias();
    }, []);

    return (
        <div className="container mt-5">
            <h2 className="mb-4">Parcerias</h2>
            <div className="row">
                {parceriasData.map((parceria) => (
                    <div className="col-6 col-md-3 mb-4" key={parceria.id_parceria}>
                        <div className="text-center">
                            <img
                                src={parceria.imagem || 'https://via.placeholder.com/150'} // Adicione uma imagem padrão se necessário
                                alt={parceria.nome}
                                className="img-fluid mb-2"
                                style={{ maxHeight: '150px', objectFit: 'cover' }}
                            />
                            <div>
                                <button className="btn p-1 me-2" style={{ color: 'blue' }}>
                                    <FaEdit size={20} />
                                </button>
                                <button className="btn p-1" style={{ color: 'red' }}>
                                    <FaTrash size={20} />
                                </button>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}
